css:
.atom-shortcuts {
  color: #91a7bb;
  font-size: 10px;
  position: absolute;
  top: 0;
  bottom: 0;
  left: 0;
  right: 0;
  margin: 3%;
  padding: 10px;
  background-color: #2d353b;
  z-index: 3;
  border: 1px solid #20252a;
}
.atom-shortcuts .left {
  float: left;
}
.atom-shortcuts .item {
  border: 1px solid #91a7bb;
  border-bottom: 0;
  padding: 5px;
}
.atom-shortcuts .item p {
  margin: 0;
  padding: 0;
}
.atom-shortcuts .item-last {
  border-bottom: 1px solid #91a7bb;
}
.atom-shortcuts .one-third {
  width: 33.3%;
}
.atom-shortcuts .section {
  padding: 5px;
  border-bottom: 0;
}
.atom-shortcuts .section h2 {
  margin: 0;
  padding: 5px 0;
}
